CREATE TABLE COUNTRY_CODE
(
    COUNTRY_CODE   VARCHAR(2)                         NOT NULL,
    LABEL          VARCHAR(100)                         NOT NULL,
    DESCRIPTION    VARCHAR(255)                        NOT NULL,
    DISPLAY_ORDER  NUMERIC   DEFAULT 1                 NOT NULL,
    EFFECTIVE_DATE TIMESTAMP                           NOT NULL,
    EXPIRY_DATE    TIMESTAMP                           NOT NULL,
    CREATE_USER    VARCHAR(100)                        NOT NULL,
    CREATE_DATE    TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    UPDATE_USER    VARCHAR(100)                        NOT NULL,
    UPDATE_DATE    TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    CONSTRAINT COUNTRY_CODE_PK PRIMARY KEY (COUNTRY_CODE)
);


CREATE TABLE STUDENT_ADDRESS
(
    STUDENT_ADDRESS_ID  UUID                                NOT NULL,
    STUDENT_ID          UUID                                NOT NULL,
    ADDRESS_LINE_1      VARCHAR(255)                        NOT NULL,
    ADDRESS_LINE_2      VARCHAR(255),
    CITY                VARCHAR(255)                        NOT NULL,
    POSTAL_ZIP          VARCHAR(10)                         NOT NULL,
    PROVINCE_STATE_CODE VARCHAR(10)                         NOT NULL,
    COUNTRY_CODE        VARCHAR(10)                         NOT NULL,
    CREATE_USER         VARCHAR(100)                        NOT NULL,
    CREATE_DATE         TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    UPDATE_USER         VARCHAR(100)                        NOT NULL,
    UPDATE_DATE         TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    CONSTRAINT STUDENT_ADDRESS_ID_PK PRIMARY KEY (STUDENT_ADDRESS_ID)
);

CREATE TABLE PROVINCE_CODE
(
    PROVINCE_CODE                     VARCHAR(10)             NOT NULL,
    LABEL                             VARCHAR(30) NOT NULL,
    DESCRIPTION                       VARCHAR(255) NOT NULL,
    DISPLAY_ORDER                     NUMERIC DEFAULT 1       NOT NULL,
    LEGACY_CODE                       VARCHAR(10),
    EFFECTIVE_DATE                    TIMESTAMP               NOT NULL,
    EXPIRY_DATE                       TIMESTAMP               NOT NULL,
    CREATE_USER                       VARCHAR(100)             NOT NULL,
    CREATE_DATE                       TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    UPDATE_USER                       VARCHAR(100)             NOT NULL,
    UPDATE_DATE                       TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,
    CONSTRAINT PROVINCE_CODE_PK PRIMARY KEY (PROVINCE_CODE)
);

